import React from 'react';
import { UncontrolledCarousel } from 'reactstrap';

const items = [
  {
    src: 'https://img.freepik.com/free-vector/vibrant-pink-watercolor-painting-background_53876-58931.jpg?size=626&ext=jpg',
    altText: 'MyBookstore',
    caption: 'MyBookstore',
    header: 'Welcome',
    key: '1'
  },
  {
    src: 'data:image/jpeg;base64,',
    altText: 'MyBookstore',
    caption: 'MyBookstore',
    header: 'Alat Tulis Sekolah',
    key: '2'
  },
  {
    src: 'data:image/jpeg;base64,',
    altText: 'MyBookstore',
    caption: 'MyBookstore',
    header: 'Alat Tulis Kantor',
    key: '3'
  }
];

const HomePage = () => <UncontrolledCarousel items={items} />;

export default HomePage;
